let initial_state = {
    city: "/moscow"
};

const MainPageReducer = (state = initial_state, action) => {
    switch(action.type)
    {
        case 'CHANGE_CITY':
            state.city = action.city;
            return state;
        default:
            return state;
    }
};

export default MainPageReducer;
